import { Fragment, useState } from "react"
const Couter = () =>{
   const [width , setWidth] = useState({
         height : 10,
         base : 30
      }
   );

   return(
      <Fragment>
         <h1>width 값: {width.height*width.base}</h1>
         <button onClick={()=>
            setWidth({
               height : <input type="text"/>,
               base: <input type="text"/>
            })
         }>입력하세요</button>
      </Fragment>
   )
};

export default Couter;
